import React from "react";
import PropTypes from "prop-types";
import { withStyles } from "@material-ui/core/styles";

import Button from "@material-ui/core/Button";
import FlightIcon from "@material-ui/icons/FlightTakeoff";

import * as send from "./../logic/sendFlightData";

const styles = theme => ({
  container: {
    flexWrap: "wrap",
    width: "100%",
    align: "center",
    float: "none",
    margin: "0 auto"
  },
  button: {
    "margin-right": "5%",
    "margin-bottom": "2%"
  }
});

class ReasonChoose extends React.Component {
  constructor() {
    super();
    this.state = {
      name: ""
    };
    this.sendDataToParent = this.sendDataToParent.bind(this);
  }

  handleChange = name => event => {
    this.setState({
      [name]: event.target.value
    });
  };

  sendDataToParent(e, params) {}

  render() {
    const { classes } = this.props;

    return (
      <form className={`${classes.container}`} noValidate autoComplete="off">
        <div className={"chooser"}>
          <h2>Was ist geschehen?</h2>
          <Button
            variant="contained"
            color="secondary"
            className={classes.button}
            onClick={this.sendDataToParent.bind(this, this.state)}
            //onClick={send.sendFirstDataToServer.bind(this, this.state)}
          >
            Verspätung
            <FlightIcon className={classes.rightIcon} />
          </Button>
          <Button
            variant="contained"
            color="secondary"
            className={classes.button}
            onClick={this.sendDataToParent.bind(this, this.state)}
            //onClick={send.sendFirstDataToServer.bind(this, this.state)}
          >
            Aufhebung
            <FlightIcon className={classes.rightIcon} />
          </Button>
          <Button
            variant="contained"
            color="secondary"
            className={classes.button}
            onClick={this.sendDataToParent.bind(this, this.state)}
            //onClick={send.sendFirstDataToServer.bind(this, this.state)}
          >
            Verweigerung
            <FlightIcon className={classes.rightIcon} />
          </Button>
          <Button
            variant="contained"
            color="secondary"
            className={classes.button}
            onClick={this.sendDataToParent.bind(this, this.state)}
            //onClick={send.sendFirstDataToServer.bind(this, this.state)}
          >
            Auf Alk
            <FlightIcon className={classes.rightIcon} />
          </Button>
        </div>
      </form>
    );
  }
}

ReasonChoose.propTypes = {
  classes: PropTypes.object.isRequired
};

export default withStyles(styles)(ReasonChoose);
